INSERT INTO `core_about` (`about_id`, `about_title`, `about_description`, `about_email`, `about_phone`, `about_website`, `ads_on`, `ads_client`, `ads_slot`, `analyt_on`, `analyt_track_id`, `facebook`, `google_plus`, `instagram`, `youtube`, `pinterest`, `twitter`, `privacypolicy`, `GDPR`, `upload_point`, `safety_tips`) VALUES
('abt1', 'Inmarket Buy and Sell', 'InMarket is an online market with secure buying and supportive selling system.\r\nInMarket is a mobile App marketing system designed perfectly for the comfort of your secure online shopping, providing platform that brings all sellers to their potential customers/buyers with financial support system (0% interest Loan) to  verified users.\r\n\r\nApp\'s Descriptions\r\nTable of contents\r\nHow to sell on InMarket?\r\nHow to buy on InMarket?\r\nSafety\r\nSell like a pro!\r\nFinancial support system (0% interest Loan)\r\n \r\nHow to sell on InMarket?\r\n1. Register\r\nRegister using your e-mail and phone number Make sure you register with  accurate genuine details,so your clients could reach you!\r\n2. Always Check your chosen location.\r\nChoose accurate location of the region you want the advert to reach, sell to the nearest customers within your location! \r\n3. Make photos of your item.\r\nFeel free to make a lot of photos using your smartphone,\r\nMake sure they show your item in the best light.\r\n4. Press SELL NOW .\r\nChoose a proper category, upload your photos and write a clear title and full description of your item. Enter a fair price, select attributes and Post your advert for free !\r\n5. Answer the messages and call from your potential  clients, Check your messages constantly and be ready to sell endlessly!\r\n\r\n\r\nHow to buy on InMarket?\r\n1. Search for the item.\r\nFind what you need through  location homepage feed or search panel and filters We have many adverts, choose exactly what you are looking for.\r\n2. Contact a seller.\r\nYou may use chat on InMarket or call them via phone. \r\nDiscuss all the details, negotiate about the price.\r\n3. Take your item or order a delivery.\r\nWe check verified sellers carefully, but it’s always better to check twice, right? Meet an unknown seller in public place and be sure to pay only after collecting your item.\r\n4. Leave your feedback about the seller.\r\nFeel free to tell us about your purchase. You can rate your feedback on the seller’s profile page and will be very helpful for other buyers. Let’s build a safe and professional business community together!\r\nGO SHOPPING! !\r\n \r\n\r\nSafety tips\r\n1. Generally \r\nWe are highly focused on the security and can solve any issues in short terms. That is why we ask you, kindly, to leave a review after purchasing. If you run into any problems with a verified seller, you can report to us and InMarket Team will check the Verified seller as soon as possible and help you sort out the issue hence we recommend you patronise verified seller’s only.\r\n2. Personal safety tips.\r\n- Do not pay in advance to an unverified seller, even for the delivery \r\n- Try to meet at a safe, public location\r\n- Check the item BEFORE you buy it\r\n- Pay only after collecting the item\r\n\r\n3. Secure payments.\r\nInMarket provides Verified Services for those who want to sell and earn more. We accept both online and offline payments for these services.\r\n We guarantee secure and reliable payments on InMarket.\r\n \r\nSell like a pro\r\n1. Pay attention to the details.\r\nMake good photos of your goods, write clear and detailed description.\r\n2. Answer quickly.\r\nDon’t make your buyer wait for your message for days. Be online or get SMS notifications on your messages.\r\n3. Get Verified with one time inmarket commitment fee  to get the trust of users and get 10x more customers you will sell faster!\r\nGET VERIFIED Now!\r\n \r\nFinancial support system for InMarket users(0% interest Loan)\r\n1.	Be a Verified Inmarket User.\r\nRegister and get verified\r\n2.	Constantly engage your page as a verified user,\r\nLoans request will be granted based on the purpose and engagement of verified users on Inmarket.\r\n\r\nInvite everyone to join INMARKET  COMMUNITY \r\nLet us build a big safe professional online market  together!\r\nSell faster! \r\nBuy safely!\r\nLet\'s go!!', 'Inmarketafrica@gmail.com', '+234900000000', '#', 0, 'ca-pub-7127831079008160', '6882887537', 0, 'UA-79164209-2', 'http://www.facebook.com/Inmarket Africa', '', 'http://www.instagram.com/inmarketafrica', '', '', '', 'TERMS OF USE\r\n\r\nACCEPTANCE OF THE TERMS\r\n\r\nThese Terms of Use (the “Terms”) constitute a binding and enforceable legal contract between InMarket Online website and Mobile Applications, its affiliated companies (together, the “Administrator”, “we”, “us”) and you. Please read these Terms carefully. Your access and use of the Inmarket.com website and mobile applications, as well as any service, content, and data available via them (together, the “Service” or the “Platform”) are governed by these Terms. If you do not agree with any part of these Terms, or if you are not eligible or authorized to be bound by the Terms, then do not access, or use the Service. Please also review our Privacy Policy . The terms of the Privacy Policy and other supplemental terms, rules, policies, or documents that may be posted on the Platform from time to time are hereby expressly incorporated herein by reference. We reserve the right, in our sole discretion, to make changes or modifications to these Terms at any time and for any reason with or without prior notice.\r\n\r\nIMPORTANT DISCLAIMERS\r\n\r\nALL SERVICES RENDERED BY THE ADMINISTRATOR ARE RENDERED “AS IS”, “AS AVAILABLE” AND “WITH ALL FAULTS”, AND THE ADMINISTRATOR DISCLAIMS ALL WARRANTIES, EXPRESSED OR IMPLIED, INCLUDING WITHOUT LIMITATION ANY GUARANTIES REGARDING CONDITION, QUALITY, LIFE DURATION, PERFORMANCE, ACCURACY, RELIABILITY, COMMERCIAL VALUE AND SUITABILITY FOR SPECIFIC PURPOSES. ALL SUCH WARRANTIES AND LIABILITIES ARE HEREBY EXCLUDED.ADMINISTRATOR HAS NO CONTROL OVER AND DOES NOT GUARANTEE THE EXISTENCE, QUALITY, SAFETY OR LEGALITY OF GOODS AND SERVICES PUBLISHED BY USERS ON THE PLATFORM; THE TRUSTWORTHINESS OR ACCURACY OF INFORMATION PROVIDED BY USERS IN THE ANNOUNCEMENTS; THE ABILITY OF SELLERS TO SELL GOODS OR TO PROVIDE SERVICES; THE ABIL